import Background from "../../images/HandStand.jpg"
import Header from "../Header";
import { Classes } from "../Data";


const Class = () => {


    let i = 0;
    return (

        <div className="classes-container">
            {Classes.map((c) => (
                <div key={c.id}>
                    <div className="class" >
                        <img className="class-photo" src={Background} />
                        <div className="class-details" data-aos="fade-up">
                            <Header title={c.title} class="black" />
                            <div className="schedules black">
                                Every {c.day} from {c.startTime} till {c.endTime}
                            </div>
                        </div>
                    </div>
                    <div className="class-desc">
                        <h5>{c.question}</h5>
                        {
                            c.advantages.map((a) => (
                                <li key={i++}>{a}</li>
                            ))
                        }
                    </div>
                </div>
            ))
            }
        </div>
    )
}

export default Class;
